import logo from './logo.svg';
import RoseLogo from './rose-logo.png';
import './App.css';
import SideNav from './SideNav.js';

function App() {
  return (
    <div className="App">
      <SideNav name='Tester'/>
      <header className="App-header">
        <img src={RoseLogo} className="App-logo"/>
        <p>
          yeah idk what's going on
        </p>
        <a
          className="App-link"
          href="https://www.youtube.com/watch?v=dQw4w9WgXcQ"
          target="_blank"
          rel="noopener noreferrer"
        >
          wow
        </a>
      </header>
    </div>
  );
}

export default App;
